import React from 'react';
import MovieList from './MovieList.js';
class DefaultView extends React.Component {
    constructor(props){
        super(props);
    }
    render()
    {
        return(
           <section>
                <MovieList movies={this.props.movies} />
            </section>
        );
    }
}

export default DefaultView;
